import PropTypes from 'prop-types';
import React, { useEffect, useState } from "react"

import { withTranslation } from "react-i18next"
import { Link } from "react-router-dom"

import {
  Table,
  Card,
  CardBody,
  Pagination,
  PaginationItem,
  PaginationLink,
  CardFooter,
  Button,
  Row,
  Col,
} from "reactstrap"
import ApiServicesDetalleDocumentacion from '../../../services/DocumentacionLegal/ApiServicesDetalleDocumentacion';
import { BpmServices, BackendServices } from "../../../services";
import { useLocation, useHistory } from "react-router-dom";


const ResultadosBusqueda = (props) => {

  const apiServiceBackend = new BackendServices();
  const location = useLocation()

  /**
   * All useState
   */
  const [dataRows, setdataRows] = useState(null);

  /**
   * End All useSate
   */

  const jsonCond = [
    'rotary',
    'commercialLoan',
    'multipleRotary',
    'rotaryNumber',
    'overdraft',
    'transfer',
    'bail',
    'trust',
    'agroPawn',
    'naturalBail',
    'legalBail',
    'crossedLegalBail',
    'crossedNaturalBail',
    'promiseLetter',
    'privateRecord',
    'trustRecord',
    'loanGuarantees',
    'fiduciaryLine',
    'prefinance',
  ]

  React.useEffect(() => {
    searchData();
  }, []);

  function capitalizarPrimeraLetra(str) {
    return str.charAt(0).toUpperCase() + str.slice(1);
  }
  
  function searchData() {
    apiServiceBackend.getLegalDocsFunction().then(docLegal => {
      setdataRows(docLegal.map((data) => (
        <tr key={data.id}>

          <td>{/*JSONCompare[index]*/}{capitalizarPrimeraLetra(data.documentName)}</td>
          <td>
            <Link to={"#"} title={props.t("View")}> <i className="mdi mdi-file-search-outline mdi-24px"></i>  </Link>
          </td>

        </tr>)
      ));
    })
    /*apiServiceBackend.consultarDocumentacionLegal(location.data.transactionId).then(async data => {
      delete data.status;
      delete data.transactId;
      delete data.legalDocumentationId;
      data = Object.entries(data).filter(([key, value]) => value).map(([key, value]) => key);
      let docLegal = await props.results.map(($$, index) => {
        if (data.some($$ => $$ === jsonCond[index]))
          return { ...$$, legal: jsonCond[index] }
      }).filter(Boolean);
      setdataRows(docLegal.map((data) => (
        <tr key={data.id}>

          <td>{data.comment}</td>
          <td>
            <Button color="link" className="btn btn-link" title={props.t("View")}> <i className="mdi mdi-file-search-outline mdi-24px"></i>  </Button>
          </td>

        </tr>)
      ));
    });*/
  }


  return (

    <Card>          
                  <Row>
                    <Col md="6">
                      <h5 className="card-sub-title">{t("LegalDocuments")}</h5>
                    </Col> 
                                        
                  </Row> 
                  
          <CardBody>
              <div className='table-responseive'>
              
                {attachments !== null && attachments !== undefined && attachments.length > 0 ?
              <Table className="table m-0">                
                <thead className="table-light">
                <tr>
                  <th>{t("Name")}</th>                  
                  <th>{t("Description")}</th>
                  <th></th>
                </tr>
              </thead>
              <tbody>
                  {(attachments.map((data) => (
                    <tr key={data.documentIdentification}>
                      <td className="px-0">{data.fileName}</td>
                      <td className="px-0">{data.fileDescription}</td>
                      <td style={{textAlign:"right"}}>
                        <Link to="#" title={t("View")} onClick={() => viewAttachment(data.onBaseIdentification)}><i className="mdi mdi-file-search-outline mdi-24px"></i></Link>
                        <Link to="#" title={t("Delete")} onClick={() => removeAttachment(data)}><i className="mdi mdi-file-remove-outline mdi-24px"></i></Link>
                      </td>
                    </tr>
                    )))}
                    </tbody>
            </Table>
                  : (
                    <Row>
                      <Col>
                      <div className="alert alert-info m-0">{t("NoAttachments")}</div>                      
                      </Col>
                    </Row>                    
                  )}

              </div>
          </CardBody>

          </Card>
        

  );
}

/*ResultadosBusqueda.propTypes = {
  results: PropTypes.array.isRequired, //Resultado de la busqueda
}*/

export default (withTranslation()(ResultadosBusqueda));
